import React, {Component} from 'react';

class NavBar extends Component {
    render() {
        return (
            <div className="navBar">
                <div>
                    // eslint-disable-next-line
                    <img className="navLeft" src="#" alt="profile photo"/>
                </div>
                <div>
                    <img className="navRight" src={require('../images/menu-ico.png')} alt="nav ico"/>
                </div>
            </div>
        );
    }
}

export default NavBar;
